$(window).scroll(function(){
	scroll = $(window).scrollTop();
  
	if (scroll >= 60) {
		$('.navbar').removeClass('navbar-transparent');
		$('.hide-inf').removeClass('hidden');
	}
	else {
		$('.navbar').addClass('navbar-transparent');
		$('.hide-inf').addClass('hidden');
	}
});